// Valid schema values
const validDocumentTypes = ['Receipt', 'Invoice', 'Bill', 'Statement', 'Medical_Report', 'Lab_Results', 'Prescription', 'Medical_Invoice'];
const validCategories = ['Groceries', 'Electronics', 'Fuel', 'Dining', 'Clothing', 'Hardware', 'Pharmacy', 'Department', 'Utilities', 'Transport', 'Entertainment', 'Health', 'Education', 'Medical', 'General'];

// Parse date to YYYY-MM-DD
function parseDate(dateStr) {
  if (!dateStr || dateStr === 'Not specified') return new Date().toISOString().split('T')[0];
  const [day, month, year] = dateStr.split('/');
  return `${year}-${month.padStart(2, '0')}-${day.padStart(2, '0')}`;
}

// Parse the primary AI response
const response = $input.item.json.response;
let parsedData;

try {
  parsedData = JSON.parse(response);
} catch (e) {
  // Fallback parsing
  const documentTypeMatch = response.match(/document_type["']?:\s*["']([^"']+)["']/i);
  const categoryMatch = response.match(/category["']?:\s*["']([^"']+)["']/i);
  const vendorMatch = response.match(/vendor["']?:\s*["']([^"']+)["']/i);
  const amountMatch = response.match(/amount["']?:\s*["']([^"']+)["']/i);
  const descriptionMatch = response.match(/description["']?:\s*["']([^"']+)["']/i);
  const dateMatch = response.match(/date["']?:\s*["']([^"']+)["']/i);
  const isMedicalMatch = response.match(/is_medical["']?:\s*["']?(true|false)["']?/i);

  parsedData = {
    document_type: documentType‡∏´‡∏ô‡∏±‡∏á‡∏™‡∏∑‡∏≠ Match ? documentTypeMatch[1] : 'Unknown',
    category: categoryMatch ? categoryMatch[1] : 'General',
    vendor: vendorMatch ? vendorMatch[1] : 'Unknown',
    amount: amountMatch ? amountMatch[1] : 'Not specified',
    description: descriptionMatch ? descriptionMatch[1] : 'Document classification',
    date: dateMatch ? parseDate(dateMatch[1]) : new Date().toISOString().split('T')[0],
    is_medical: isMedicalMatch ? isMedicalMatch[1].toLowerCase() === 'true' : false
  };
}

// Validate against schema
parsedData.document_type = validDocumentTypes.includes(parsedData.document_type) ? parsedData.document_type : 'Unknown';
parsedData.category = validCategories.includes(parsedData.category) ? parsedData.category : 'General';

// Sanitize document_image_path
const sanitizePath = (str) => str.replace(/[^a-zA-Z0-9-_]/g, '_').replace(/_+/g, '_');

// Create formatted data
const title = sanitizePath(`${parsedData.document_type}_${parsedData.category}_${parsedData.vendor}`);
const description = `Document Type: ${parsedData.document_type}\nCategory: ${parsedData.category}\nVendor: ${parsedData.vendor}\nAmount: ${parsedData.amount}\nDescription: ${parsedData.description}\nDate: ${parsedData.date}\n\nProcessed from Telegram on ${new Date().toISOString()}`;

// Project mapping
const categoryProjectMap = {
  'Groceries': 1, 'Electronics': 2, 'Fuel': 3, 'Dining': 4, 'Clothing': 5,
  'Hardware': 6, 'Pharmacy': 7, 'Department': 8, 'Utilities': 9, 'Transport': 10,
  'Entertainment': 11, 'Health': 12, 'Education': 13, 'Medical': 14, 'General': 15
};

const projectId = categoryProjectMap[parsedData.category] || categoryProjectMap['General'];

return {
  json: {
    ...parsedData,
    formatted_title: title,
    formatted_description: description,
    project_id: projectId,
    original_response: response,
    telegram_user_id: $('Telegram Trigger').item.json.message.from.id,
    telegram_username: $('Telegram Trigger').item.json.message.from.username || 'Unknown'
  }
};

// Valid schema values
const validUrgencyLevels = ['Low', 'Medium', 'High', 'Critical'];
const validMedicalCategories = ['Cardiology', 'Pathology', 'Radiology', 'General'];

// Parse date to YYYY-MM-DD
function parseDate(dateStr) {
  if (!dateStr || dateStr === 'Not specified') return null;
  const [day, month, year] = dateStr.split('/');
  return `${year}-${month.padStart(2, '0')}-${day.padStart(2, '0')}`;
}

// Parse medical AI response
const medicalResponse = $input.item.json.response;
let medicalData;

try {
  medicalData = JSON.parse(medicalResponse);
} catch (e) {
  // Fallback parsing for medical data
  medicalData = {
    patient_name: 'Not specified',
    date_of_birth: 'Not specified',
    test_date: 'Not specified',
    doctor_name: 'Not specified',
    clinic_name: 'Not specified',
    test_type: 'Not specified',
    test_results: 'Not specified',
    abnormal_values: 'Not specified',
    recommendations: 'Not specified',
    diagnosis: 'Not specified',
    medications: 'Not specified',
    next_appointment: 'Not specified',
    urgency_level: 'Low',
    medical_category: 'General'
  };
}

// Validate and parse dates
medicalData.date_of_birth = parseDate(medicalData.date_of_birth);
medicalData.test_date = parseDate(medicalData.test_date);
medicalData.next_appointment = parseDate(medicalData.next_appointment);

// Validate against schema
medicalData.urgency_level = validUrgencyLevels.includes(medicalData.urgency_level) ? medicalData.urgency_level : 'Low';
medicalData.medical_category = validMedicalCategories.includes(medicalData.medical_category) ? medicalData.medical_category : 'General';

// Get primary classification data
const primaryData = $('Process Primary Classification').item.json;

// Combine all data
return {
  json: {
    ...primaryData,
    medical_details: medicalData,
    processing_timestamp: new Date().toISOString()
  }
};

